import React,{useState} from 'react'
import classNames from 'classnames'

import './reset.css'
export default function Reset(props) {

    const [inputData,setInputData] = useState()

    function handleChange (event) {
        const {value} = event.target
        setInputData(value)
    
    }
    function handleSubmit (event) {
        event.preventDefault()
    }

    return (
        <form onSubmit={handleSubmit} className = 'reset--password sign--in'>
            <h2 className='form--title'>Reset your password</h2>
            <p className='description'>We'll email you instructions to reset the password.</p>
            <input 
                type='text'
                name='emailOrPhone'
                value = {inputData}
                onChange = {handleChange}
                placeholder = 'Email or mobile phone'
            />
            <button className={classNames('sign--submit',{"valid--value":props.activateButton})} >Reset password</button>
            <h5>Return to login</h5>

        </form>
  )
}
